(function execute(inputs, outputs) {
  var nomi = inputs.req;
  var nomineeInfos = nomi.data.nomineeInfos;

  // Calculate age from the first nominee's date of birth
  var age = nomineeInfos[0].dob;
  var NomDob = age.split("/").reverse().join("-");
  var nomDob = new x_rptp_smartinte_0.moment().diff(NomDob, 'years').toString().split(".")[0];

  // If there's only one nominee
  if (nomineeInfos.length == 1) {
    outputs.name = nomineeInfos[0].frstNm + " " + nomineeInfos[0].lstNm;
    outputs.dob = nomineeInfos[0].dob;
    outputs.relation = nomineeInfos[0].relationship;
    outputs.place_of_birth = nomineeInfos[0].city;
  }

  // Check age and nominee length
  if (nomDob < 18) {
    if (nomineeInfos.length > 1) {
      // Find the first apnteDtls from multiple nominees
      for (let nominee of nomineeInfos) {
        if (nominee.apnteDtls) {
          // Assign values from the first encountered apnteDtls
          outputs.apnname = nominee.apnteDtls.frstNm + " " + nominee.apnteDtls.lstNm;
          outputs.apndob = nominee.apnteDtls.dob;
          outputs.apnrlnip = nominee.apnteDtls.relationship;
          outputs.apnnomrln = nominee.apnteDtls.relatedParty;
          break; // Stop after finding the first one
        }
      }
    } else if (nomineeInfos[0].apnteDtls) {
      // If there's only one nominee but has apnteDtls
      outputs.apnname = nomineeInfos[0].apnteDtls.frstNm + " " + nomineeInfos[0].apnteDtls.lstNm;
      outputs.apndob = nomineeInfos[0].apnteDtls.dob;
      outputs.apnrlnip = nomineeInfos[0].apnteDtls.relationship;
      outputs.apnnomrln = nomineeInfos[0].apnteDtls.relatedParty;
    }
  }
})(inputs, outputs);

